import mongoose from 'mongoose';
import dotenv from 'dotenv';
import User from '../models/User.js';
import Trip from '../models/Trip.js';

// Load environment variables
dotenv.config();

// Connect to MongoDB
mongoose.connect(process.env.MONGODB_URI)
  .then(() => console.log('Connected to MongoDB'))
  .catch(err => {
    console.error('MongoDB connection error:', err);
    process.exit(1);
  });

// Sample admin user ID - you'll need to replace this with a real admin user ID from your database
let adminId;

const clearDatabase = async () => {
  try {
    // Only clear trips, not users
    await Trip.deleteMany({});
    console.log('Trips database cleared');
    
    // Find or create an admin user
    const adminUser = await User.findOne({ email: 'admin@college.edu' });
    if (adminUser) {
      adminId = adminUser._id;
      console.log('Admin user found');
    } else {
      const newAdmin = new User({
        name: 'College Admin',
        email: 'admin@college.edu',
        password: '$2a$10$XOPbrlUPQdwdJUpSrIF6X.LbE14qsMmKGhM1A8W9iqaG3vv1MpnX.', // password: admin123
        phone: '9876543210',
        address: {
          street: 'College Campus',
          city: 'Jaipur',
          state: 'Rajasthan',
          country: 'India',
          zipCode: '302001'
        }
      });
      const savedAdmin = await newAdmin.save();
      adminId = savedAdmin._id;
      console.log('Admin user created');
    }
  } catch (error) {
    console.error('Error clearing database:', error);
    process.exit(1);
  }
};

